/**
 * Grab the contents of a file from the _data directory at root of this repository. Valid encodings are the same as
 * those passed to Node.JS's fs.ReadFileSync(). 'utf8' (the default) will return a string. 'buffer' will return a raw
 * bytestring.
 * @param {string} name
 * @param {string} encoding
 * @return {string | Buffer}
 */
exports.get_data_file = function(name, encoding) {
    let buff;
    switch (name) {
    case 'p0022_names.txt':
        buff = '';
        break;
    case 'p0042_words.txt':
        buff = '';
        break;
    case 'p0059_cipher.txt':
        buff = '';
        break;
    case 'p0067_triangle.txt':
        buff = '';
        break;
    case 'p0081_matrix.txt':
        buff = '';
        break;
    case 'p0089_roman.txt':
        buff = '';
        break;
    case 'p0099_base_exp.txt':
        buff = '';
        break;
    default:
        throw new Exception('Unknown file name');
    };
    const result = Buffer.from(buff, 'base64');
    if (encoding !== 'buffer') {
        return result.toString(encoding);
    }
    return result;
};
